import './Footer.css'
export default class Footer extends React.Component {
  constructor(props) {
    super(props);
   this.selected=false;
  }
componentDidMount(){

}
 changeimg(){
   console.log(22)
 }

  render() {
	  return (
	  <div >
	  <ul className='footbar'>
      <li onClick={this.changeimg}><p><img src={require("./imgs/logo1.png")} alt=""/></p>
	  <p>首页</p></li>
      <li><p><img src={require("./imgs/logo1.png")} alt=""/></p><p>发现</p></li>
      <li><p><img src={require("./imgs/logo1.png")} alt=""/></p><p>订单</p></li>
      <li><p><img src={require("./imgs/logo1.png")} alt=""/></p><p>我的</p></li>
    </ul>
	  </div>
	  )
  }
}
